import toCart from './../../img/products/ToCart.svg'

const Card = (props) => {
    console.log(props.title);
    return(
        <div className="card">
            
                <button className="img">
                    <img src={props.imageUrl} alt='products' />
                </button>
                        <p>{props.category}</p>
                        <a>{props.title}</a>
                        <b>{props.price} руб.</b>
            
                    <button className="add" onClick={() => alert(props.title)}>
                        <img src={toCart} ></img>
                    </button>
                
            </div>
    );
}

export default Card;
